package Bai2;public class City {    private String cityId;    private String cityName;    private boolean cityStatus;    public String getCityId() {        return cityId;    }    public void setCityId(String cityId) {        this.cityId = cityId;    }    public String getCityName() {        return cityName;    }    public void setCityName(String cityName) {        this.cityName = cityName;    }    public boolean isCityStatus() {        return cityStatus;    }    public void setCityStatus(boolean cityStatus) {        this.cityStatus = cityStatus;    }}